import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { api } from "../../api/apiconfig"; // Adjust path according to your file structure

const Records = () => {
  const [height, setHeight] = useState("");
  const [weight, setWeight] = useState("");
  const [bloodGroup, setBloodGroup] = useState("");
  const [medicalHistory, setMedicalHistory] = useState("");
  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (height && weight && bloodGroup) {
      try {
        const response = await api.post('/records', {
          height,
          weight,
          bloodGroup,
          medicalHistory,
        }, {
          headers: {
            'userId': userId
          }
        });

        console.log('Record submitted successfully:', response.data);
        navigate('/dashboard'); // Redirect on success
      } catch (error) {
        console.error('Error submitting the record:', error);
      }
    } else {
      alert('Please fill in all required fields.');
    }
  };

  return (
    <div className="h-screen flex items-center justify-center">
      <section className="w-[512px] bg-custombg p-4 flex flex-col border rounded-2xl">
        <h1 className="text-center text-white text-3xl mb-4">Records</h1>
        <form onSubmit={handleSubmit} className="flex flex-col space-y-4">
          <div>
            <label htmlFor="height" className="text-white font-bold text-xl">Height (cm):</label>
            <input
              type="number"
              id="height"
              value={height}
              onChange={(e) => setHeight(e.target.value)}
              required
              className="mt-1 block w-full px-3 py-2 rounded-md text-black text-lg"
            />
          </div>

          <div>
            <label htmlFor="weight" className="text-white font-bold text-xl">Weight (kg):</label>
            <input
              type="number"
              id="weight"
              value={weight}
              onChange={(e) => setWeight(e.target.value)}
              required
              className="mt-1 block w-full px-3 py-2 rounded-md text-black text-lg"
            />
          </div>

          <div>
            <label htmlFor="bloodGroup" className="text-white font-bold text-xl">Blood Group:</label>
            <select
              id="bloodGroup"
              value={bloodGroup}
              onChange={(e) => setBloodGroup(e.target.value)}
              required
              className="mt-1 block w-full px-3 py-2 rounded-md text-black text-lg"
            >
              <option value="">Select Blood Group</option>
              <option value="A+">A+</option>
              <option value="A-">A-</option>
              <option value="B+">B+</option>
              <option value="B-">B-</option>
              <option value="AB+">AB+</option>
              <option value="AB-">AB-</option>
              <option value="O+">O+</option>
              <option value="O-">O-</option>
            </select>
          </div>

          <div>
            <label htmlFor="medicalHistory" className="text-white font-bold text-xl">Medical History:</label>
            <textarea
              id="medicalHistory"
              value={medicalHistory}
              onChange={(e) => setMedicalHistory(e.target.value)}
              className="mt-1 block w-full px-3 py-2 rounded-md text-black text-lg"
              rows="4"
            />
          </div>

          <button
            type="submit"
            className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded"
          >
            Submit
          </button>
        </form>
      </section>
    </div>
  );
};

export default Records;
